import React, { Component } from "react";
import {
  MDBContainer,
  MDBBtn,
  MDBModal,
  MDBModalBody,
  MDBModalHeader,
  MDBModalFooter,
  MDBFooter,
} from "mdbreact";
import { MDBRow, MDBCol, MDBInput } from "mdbreact";
import { connect } from "react-redux";

class ModalEditProduct extends Component {
  render() {
    console.log("ici modal", this.props.prodShow);

    return (
      <MDBContainer>
        <MDBModal
          isOpen={this.props.Modalopenshow}
          toggle={() => this.props.toggleshow()}
          fullHeight
          position="top"
        ></MDBModal>
        <h1>{this.props.prodShow.id}</h1>
        <MDBFooter>
          <a onClick={() => this.props.toggleshow()}>Fermer</a>
        </MDBFooter>
      </MDBContainer>
    );
  }
}

export default connect(null, null)(ModalEditProduct);
